import React from 'react';
import { Link } from 'react-router-dom';
import { Menu, Sidebar,MenuItem } from 'react-pro-sidebar';

const SideBar = () => {
    return (
        <div className="sidebar">
            <Sidebar
            collapsed = 'true'
            backgroundColor='red'
            toggled='true'
            ><Menu>
                <MenuItem >Profile
                </MenuItem>
                </Menu>
                </Sidebar>
        </div>
    );
};

export default SideBar;
